import React from 'react'

function AboutUsPage() {
  return (
      <div>
          <p>About Us.</p>
          <p>quizmingle.com is a online fun website to play movie quiz and guessing quiz. Here you can create couple quiz to test how well your partner knows you as well as quiz for your friends. In addition to these personal quizes you can also play movie quizes and you can even challenge your friends in these movie quizes. At the end of your movie quiz you will get personalize link to create competetion and challenge your friends. You will be able to see your scores as well as your friends scores. This is fun website made for everyone with love. Thank you!</p>
    </div>
  )
}

export default AboutUsPage
